                  </td></tr>
			 <tr><td height="15"></td></tr>
			 <tr><td><p class="noticia-e2" align="justify"><img src="../imagenes/gobelqui.png" alt=" Sof&iacute;a Villalobos Humeres, Gobernadora Provincial de Elqui. " width="239" height="281" hspace="5" vspace="3" border="1" align="left" /> 
                    La Gobernadora de Elqui; Sof&iacute;a Villalobos Humeres, 
                    destac&oacute; el trabajo realizado por este servicio en materias 
                    de seguridad ciudadana, derechos humanos, y los avances en 
                    infraestructura en las seis comuna que componen la provincia, 
                    resaltando como tareas futuras buscar lograr una mayor integraci&oacute;n 
                    con la Provincia de San Juan Argentina en &aacute;reas como 
                    el comercio y el turismo.</p>
			      <p class="noticia-e2" align="justify"> Desde que asumi&oacute; 
                    como Gobernadora Provincial de Elqui, en diciembre del 2002, 
                    Sof&iacute;a Villalobos Humeres, se ha destacado por su constante 
                    trabajo en terreno. Trabajo que despu&eacute;s de un a&ntilde;o 
                    y tres meses de gesti&oacute;n ha reportado frutos que fueron 
                    compartidos con la comunidad en el sector de Tierras Blancas, 
                    con motivo de la entrega de la Primera Cuenta Publica de la 
                    Gobernaci&oacute;n de Elqui.</p>
			      
			  </td></tr>
