		<tr><td height="25"></td></tr>
        <tr> 
          <td>
		     <table width="100%" border="0" cellspacing="0" cellpadding="0">
			 <tr>
                <td> <p class="noticia-e2" align="justify"> <strong>Seguridad 
                    Ciudadana: Menos rejas, más confianza entre los vecinos.</strong><br>
                    La seguridad ciudadana ha sido uno de los ejes principales 
                    del trabajo de la Gobernaci&oacute;n, la ejecuci&oacute;n 
                    e implementaci&oacute;n de programas como Barrio M&aacute;s 
                    Seguro en el sector El Olivar, El Progreso y H&eacute;roes 
                    de la Concepci&oacute;n en Las Compa&ntilde;&iacute;as, ha 
                    derivado en una fuerte intervenci&oacute;n de la autoridad 
                    en estos sectores potenciando la realizaci&oacute;n de talleres 
                    formativo e informativos en las diferentes organizaciones 
                    sociales. La habitaci&oacute;n de dos canchas de futbolitos 
                    y la construcci&oacute;n de un mirador han permitido a los 
                    vecinos del sector la recuperaci&oacute;n de espacios que 
                    hasta hace poco consideraban perdidos.</p>
			      <p class="noticia-e2" align="justify"> La Gobernadora destac&oacute; 
                    que &#8220;durante los meses de ejecuci&oacute;n de este programa 
                    en El Olivar disminuyeron las denuncias de delitos alta connotaci&oacute;n 
                    social en un 43,2% en el 2003, atribuibles al plan de trabajo 
                    focalizado desarrollado por la Gobernaci&oacute;n de Elqui 
                    en conjunto con Carabineros y Polic&iacute;a de Investigaciones 
                    de Chile y la colaboraci&oacute;n decidida de los vecinos 
                    de dicho sector&#8221;.</p>
			      <p class="noticia-e2" align="justify"> Adem&aacute;s, la Gobernadora 
                    resalt&oacute; que este a&ntilde;o se comienza a construir 
                    la Comisar&iacute;a de Las Compa&ntilde;&iacute;as con una 
                    dotaci&oacute;n de 111 carabineros, con una inversi&oacute;n 
                    de 1.103 millones de parte del Gobierno Regional.</p>
				  <p class="noticia-e2" align="justify">Tambi&eacute;n destac&oacute; 
                    la pol&iacute;tica de modernizaci&oacute;n del sistema penitenciario, 
                    lo que permitir&aacute; tener recintos carcelarios con condiciones 
                    dignas para la poblaci&oacute;n penal, dicho centro se ubicar&aacute; 
                    en el sector de Huchalalume y albergar&aacute; a un total 
                    de 1.600 reos con una inversi&oacute;n de 20 millones de d&oacute;lares.</p>
			  </td></tr>
			  <tr><td height="25"></td></tr>
			 <tr>
                <td> <p class="noticia-e2" align="justify"> <strong>No hay mañana 
                    sin ayer: la irrenunciable lucha por los derechos humanos.</strong><br>
                    En materia de derechos humanos la primera autoridad provincial 
                    se&ntilde;al&oacute; que &#8220;desde noviembre del a&ntilde;o 
                    pasado la Comisi&oacute;n Presidencial de Prisi&oacute;n Pol&iacute;tica 
                    y Tortura, est&aacute; llevando a cabo en la provincia de 
                    Elqui, un trabajo, complejo y digno en la reivindicaci&oacute;n 
                    de los derechos humanos, que m&aacute;s all&aacute; de compensaciones 
                    o prestaciones del estado, quienes sufrieron la tortura y/o 
                    fueron presos pol&iacute;ticos, nos han abierto una puerta 
                    a esa intimidad dolorosa y a&uacute;n inexplicable que vivieron 
                    y as&iacute; estamos reconstruyendo nuestra historia, la estamos 
                    poniendo en conocimiento de todos y todas las personas, generaciones 
                    de ayer y las de un futuro m&aacute;s cercano&#8221;.</p>
			</td></tr>
			  <tr><td height="25"></td></tr>
			 <tr>
                <td> <p class="noticia-e2" align="justify"> <strong>Infraestructura: 
                    mejores caminos para un mayor crecimiento.</strong><br>
                    En cuanto a la inversi&oacute;n, el Fondo de Desarrollo Regional, 
                    el Gobierno y los consejeros regionales, han invertido en 
                    el a&ntilde;o 2003 $2.935.000 millones en las seis comunas 
                    de la Provincia de la destac&aacute;ndose proyectos como el 
                    mejoramiento de la caleta pesquera de Chungungo, en La Higuera; 
                    la ampliaci&oacute;n del Consultorio general urbano de Tierras 
                    Blancas y la construcci&oacute;n de grader&iacute;as del estadio 
                    Francisco S&aacute;nchez Rumoroso, en Coquimbo; el mejoramiento 
                    del pavimento rural en la localidad de Las Rojas, en La Serena; 
                    la Reposici&oacute;n de la Escuela de Gualliguaica, en Vicu&ntilde;a 
                    y la adquisici&oacute;n del terreno para la construcci&oacute;n 
                    del Liceo Polivalente de la comuna de Paihuano.</p>
			</td></tr>
			  <tr><td height="25"></td></tr>
			 <tr>
                <td> <p class="noticia-e2" align="justify"> <strong>Lo que viene 
                    : los sueños de las generaciones emergentes.</strong><br>
                    Para gobernadora de Elqui, existen tareas y prop&oacute;sito 
                    como provincia que a su juicio son insoslayables y que hablan 
                    de las potencialidades de la Regi&oacute;n. En esa perspectiva 
                    la integraci&oacute;n con argentina es un reto permanente 
                    &#8220;estamos ad porta de conocer el resultado del estudio 
                    de prefactibilidad t&eacute;cnico-financiero para una soluci&oacute;n 
                    vial, t&uacute;nel en altura, que permitir&aacute; mantener 
                    nuestro paso fronterizo de Agua Negra, abierto todo el a&ntilde;o&#8221;.</p>
                <p class="noticia-e2" align="justify">En este punto se destacó la realización del XIII Encuentro del Comité de Fronteras, en el cual se incorporaron dos nuevos actores que potenciaran el accionar integrador binacional  con nuevos actores que representan la mirada de los trabajadores y los alcaldes de la región. Según la Gobernadora “la integración con el resto del cono  sur, a través de la materialización del corredor bioceànico, proyectará nuestra economía, turismo, actividad académica y científica, entregando nuevas oportunidades de desarrollo para toda la región”.</p>
